text:
לדבריו, בנאום זה עשה דיין שימוש בשלושה סוגי רטוריקה:
רטוריקה טִקסית (שמטרתה לגבש את הציבור ולטפח ערכים וסמלים משותפים המעוררים הזדהות) – ;
רטוריקה אפולוגטית (שמטרתה להסביר כישלון או מדיניות שגויה או להסיר מהדובר אחריות לכישלון ולעורר אמינות לפועלו העתידי) – ;
ורטוריקה מניעה (רטוריקה שנועדה להניע את הציבור לפעולה בעתיד) –
